import { Link } from 'react-router-dom';

const Error401 = () => {
	return (
		<div className="view-error-401">
			<h1>Bạn không có quyền truy cập trang này</h1>
			<Link to="/">Quay lại trang chủ</Link>
		</div>
	);
};

export default Error401;
